def convert(n):
    s = ''
    while (n > 0):
        if (n & 1):
            s = '1' + s
        else:
            s = '0' + s
        n = n >> 1
    return s
def ccc(s):
    n = 0
    for i in s:
        n = n << 1
        if (i == '1'):
            n = n | 1
    return n 
